		var THEMES_CODE = {
			'material_theme': 'material',
			'flat_theme': 'flat',
			'defaulttheme': 'default'
		};
		var DEFAULT_THEME_CODE = 'default';

		// Property deprecated
		var iconsMap = (function() {

			var icons = _getIconsList(DEFAULT_THEME_CODE);
			var map = {};

			icons.forEach(function(el, ind) {

				map[el] = true;
			});

			return map;
		})();

		// Method deprecated
		function isClassCreated(iconClass) {
			
			return iconClass in iconsMap;
		}

		function getIcons(themeCode) {

			return _getIconsList(THEMES_CODE[themeCode] || DEFAULT_THEME_CODE);
		}

		function _getIconsList(themeCode) {

			var iconsKey = 'ICONS_' + themeCode;
			var storageIcons = window.sessionStorage.getItem(iconsKey);
			var url = _getIconsUrl(themeCode);
			var list;

			// retorna os ícones armazenados no session storage
			// caso eles existam
			if (storageIcons) {
				return JSON.parse(storageIcons);
			}

			$.ajax({
				type: 'GET',
				url: url,
				dataType: 'json',
				// TODO: quando for possível escrever componente com ES6
				// remover essa chamada síncrona e trocar por async await
				async: false,
				success: function(resp) {

					// armazena os ícones para poder reaproveitar
					// eles caso seja chamado novamente
					window.sessionStorage.setItem(iconsKey, JSON.stringify(resp.icons));
					list = resp.icons;
				}
			});

			return list;
		}

		function _getIconsUrl(themeCode) {

			if(themeCode === 'flat') {
				return '/style-guide/js/icons/Flat-Icons/icons.json';
			} else if(themeCode === 'material') {
				return '/style-guide/js/themes/flat/icons/icons.json';
			}else {
				return '/style-guide/js/themes/' + themeCode + '/icons/icons.json';
			}
		}

